properties.source:
//function
${function}(ctx){

  var context = Whirl.JavaScriptContext.init(ctx);    
  var source = context.getSource();
  var fields = source.getDataValue();
  var rows = fields.getValues();

  var ids = (rows.length <= 0)? 'empty': '';
  for (var i = 0; i < rows.length; i++) {
    var row = rows[i];
    ids = ids + row.getId();
    if(i < rows.length - 1) {
    	ids = ids + ',';
    }
  }

  Whirl.Builders.findBuilderByCode("grid_sel_id").setHtml(ids);
  Whirl.Builders.findBuilderByCode("grid_trans_id").setHtml('empty');
}

