//function
${function}(ctx){
  var context = Whirl.JavaScriptContext.init(ctx);
  Whirl.Builders.findBuilderByCode('combo_trans_id').setHtml('empty');
  var selected = context.getParameter(0).getListValue();
  if(selected != null) {
  	var id = selected.getId();
  	var label = selected.getLabel();
	Whirl.Builders.findBuilderByCode('combo_trans_id').setHtml(id);
  }
}

