//function
${function}(ctx){

  const OUT_CODE = "combo_trans_id";

 	var context = Whirl.JavaScriptContext.init(ctx);
   	var value = context.getParameterByCode('text').getStringValue();
  	if(value != null && value != '') {
		Whirl.Builders.findBuilderByCode(OUT_CODE).setHtml(value);
  	}	
}

