  Whirl.Builders.findBuilderByCode(OUT_CODE).setHtml('empty');
}

//function
${function}(ctx){
  var context = Whirl.JavaScriptContext.init(ctx);
  var list = context.getParameterByCode('list_component');
  if(list == null) {
    alert('list_component parameter is NULL');
  }

  var res = context.newResult();

  var p = new Whirl.EventParameter("DATAVALUE");
  p.setData(list);
  p.setCode('list');

  res.addParameter(p);
  res.setNextEventCode('js_output_rowlist');

  return res;  
}

//function
/*
требует параметры
list_component
output_label_code

*/
${function}(ctx){

  const OUT_CODE = "tree_trans_id";

  Whirl.Builders.findBuilderByCode(OUT_CODE).setHtml('empty');

  var context = Whirl.JavaScriptContext.init(ctx);
  var selected = context.getParameterByCode('list');
  if(selected == null) {
    alert('Input parameter is NULL');
    return;
  }

  var rows = selected.getValues();
  var ids = "";

  for (var i = 0; i < rows.length; i++) {
    var row = rows[i];
    ids = ids + row.getId();
    if(i < rows.length - 1) {
      ids = ids + ',';
    }
  }
  if(ids != '') {
    Whirl.Builders.findBuilderByCode(OUT_CODE).setHtml(ids);
  }
}

