//function
${function}(ctx){
  var context = Whirl.JavaScriptContext.init(ctx);    
  var row = context.getSource().getValue();
  if(row == null) {
  	Whirl.Builders.findBuilderByCode('combo_sel_id').setHtml('empty');  
  } else {
    if(row.getId() == null || row.getId() == '') {
      Whirl.Builders.findBuilderByCode('combo_sel_id').setHtml('empty');  
    } else {
      Whirl.Builders.findBuilderByCode('combo_sel_id').setHtml(row.getId());
    }
  }
  Whirl.Builders.findBuilderByCode('combo_trans_id').setHtml('empty');
}

